source.buildSpec:
{
  "version": 0.2,
  "phases": {
    "install": {
      "runtime-versions": {
        "nodejs": "14"
      },
      "commands": [
        "npm install",
        "npm install -g aws-cdk "
      ]
    },
    "build": {
      "commands": [
        "npm run build",
        "cdk synth --output ./cdk.out"
      ]
    }
  },
  "artifacts": {
    "base-directory": "cdk.out",
    "files": [
      "**/*"
    ]
  }
}
